import React from 'react';
import { Link } from 'react-router-dom';

function Page2() {
    return (
        <div>
            <h1>Page 2</h1>
            <Link to="/page1" className="btn btn-primary">Go to Page 1</Link>
        </div>
    );
}

export default Page2;
